import React, { Component } from "react";
import { GreenButton } from "../GreenButton/GreenButton";
import styles from "./ReceivedItemModal.module.scss";

export default class ReceivedItemModal extends Component {
  constructor(props) {
    super(props);
    switch (this.props.type) {
      case 1:
        this.state = {
          receivedItemModalBgClass: styles.receivedItemModal_blue,
          receivedItemModalBg: `url("/images/linedbgblue.jpg")`
        };
        break;
      case 2:
        this.state = {
          receivedItemModalBgClass: styles.receivedItemModal_purple,
          receivedItemModalBg: `url("/images/linedbgpurple.jpg")`
        };
        break;
      case 3:
        this.state = {
          receivedItemModalBgClass: styles.receivedItemModal_pink,
          receivedItemModalBg: `url("/images/linedbgpink.jpg")`
        };
        break;
      case 4:
        this.state = {
          receivedItemModalBgClass: styles.receivedItemModal_red,
          receivedItemModalBg: `url("/images/linedbgred.jpg")`
        };
        break;
      case 5:
        this.state = {
          receivedItemModalBgClass: styles.receivedItemModal_special,
          receivedItemModalBg: `url("/images/linedbgred.jpg")`
        };
        break;
      case 6:
        this.state = {
          receivedItemModalBgClass: styles.receivedItemModal_consumerGrade
        };

      default:
        break;
    }
  }

  render() {
    return (
      <div
        style={{ backgroundImage: this.state.receivedItemModalBg }}
        className={`${styles.receivedItemModal}`}
      >
        <h1 className={styles.itemTitle}>{this.props.title}</h1>
        <div className={`${styles.imageWrap}`}>
          <img src={this.props.image} alt='' />
        </div>
        <div className={styles.bottomWrap}>
          <span>You got a new item!</span>
          <GreenButton
            onClick={() => {
              this.props.onSubmit();
            }}
            text={"Continue"}
          />
        </div>
      </div>
    );
  }
}
